// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";


abstract contract ExtendedAccessControl is AccessControl{
	 
	struct teamMemberVotation {
        address firstApproval;
        address secondApproval;
    }
	
	mapping(address => mapping(bytes32 => teamMemberVotation)) _rolesApproval;
    mapping(address => mapping(bytes32 => teamMemberVotation)) _rolesRemotion;


	   function revokeRole(bytes32 role, address account)
        public
        override
        onlyRole(getRoleAdmin(role))
    {
        _revokeRoleVote(account, role);

        if (
            _rolesRemotion[account][role].firstApproval != address(0) &&
            _rolesRemotion[account][role].secondApproval != address(0)
        ) {
            super.revokeRole(role, account);
            _rolesRemotion[account][role].firstApproval = address(0);
            _rolesRemotion[account][role].secondApproval = address(0);
        }
    }

    function grantRole(bytes32 role, address account) public override {
        _approveRoleVote(account, role);
        if (
            _rolesApproval[account][role].firstApproval != address(0) &&
            _rolesApproval[account][role].secondApproval != address(0)
        ) {
            super.grantRole(role, account);
            _rolesApproval[account][role].firstApproval = address(0);
            _rolesApproval[account][role].secondApproval = address(0);
        }
    }

    function _approveRoleVote(address _address, bytes32 _role)
        public
        returns (bool)
    {
        require(_address != address(0));
        require(
            _rolesApproval[_address][_role].firstApproval != msg.sender &&
                _rolesApproval[_address][_role].secondApproval != msg.sender,
            "You can vote only one time"
        );

        if (_rolesApproval[_address][_role].firstApproval == address(0)) {
            _rolesApproval[_address][_role].firstApproval = msg.sender;
        } else {
            _rolesApproval[_address][_role].secondApproval = msg.sender;
        }

        return true;
    }

    function _revokeRoleVote(address _address, bytes32 _role)
        public
        returns (bool)
    {
        require(_address != address(0));
        require(
            _rolesRemotion[_address][_role].firstApproval != msg.sender &&
                _rolesRemotion[_address][_role].secondApproval != msg.sender,
            "You can vote only one time"
        );

        if (_rolesRemotion[_address][_role].firstApproval == address(0)) {
            _rolesRemotion[_address][_role].firstApproval = msg.sender;
        } else {
            _rolesRemotion[_address][_role].secondApproval = msg.sender;
        }
        return true;
    }
}
